import React, { useEffect } from 'react';
import Cookies from 'js-cookie';
import GoogleButton from 'react-google-button'
function Dashboard() {
    const handleGoogleLogin = async () => {
      try {
        // Redirect to Google authentication endpoint on your backend
        window.location.href = 'http://localhost:5000/google'; // Replace with your actual endpoint
      } catch (error) {
        console.error('Error logging in with Google:', error);
      }
    };

    useEffect(() => {
      // Retrieve the 'token' cookie value
      const token = Cookies.get('token');

      // Use the token as needed (e.g., send it with API requests, store in state, etc.)
      console.log('Token:', token);
      // Perform actions with the token here
    }, []);
    return (
      <div>
        <h1>Welcome</h1>
        <GoogleButton onClick={handleGoogleLogin}>Login with Google</GoogleButton>
      </div>
    );
  };


export default Dashboard;
